  \"2014-12-05T17:58:22.827452\",\n\t\"name\": \"tiger-line-shapefile-2013-series-information-file-for-the-current-state-legislative-district-slb5a37\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selectedn               geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencingn               (MAF/TIGER) Database (MTDB).
  The MTDB represents a seamless national file with no overlaps or gaps between parts,
  however, each TIGER/Line shapefile isn               designed to stand alone as
  an independent data set, or they can be combined to cover the entire nation.n               n
  \              State Legislative Districts (SLDs) are the areas from which members
  are elected to State legislatures. The SLDs embody the upper (senate) and lowern
  \              (house) chambers of the State legislature. Nebraska has a unicameral
  legislature and the District of Columbia has a single council, both of which then
  \              Census Bureau treats as upper-chamber legislative areas for the purpose
  of data presentation; there are no data by SLDL for either Nebraska or then               District
  of Columbia. A unique three-character census code, identified by State participants,
  is assigned to each SLD within a state.  In Connecticut,n               Illinois,
  Louisiana, Maine, Maryland, Massachusetts, Michigan, Ohio, and Puerto Rico, the
  Redistricting Data Program (RDP) participant did not define then               SLDs
  to cover all of the state or state equivalent area. In these areas with no SLDs
  defined, the code \"ZZZ\" has been assigned, which is treated as an               single
  SLD for purposes of data presentation.n               n               The boundaries
  of the 2012 State legislative districts were provided by State-level participants
  through the RDP and reflect the districts used to electn               members in
  or prior to the November 2012 election.\",\n\t\"license_title\": \"Creative Commons
